import { createTheme } from "@mui/material/styles";


//Theme Variable wird erzeugt 

export const theme = createTheme({
    palette: {  // Palette wird creiert 
      primary: {
        light: '#757ce8',
        main: 'darkblue',
        dark: '#002884',
        contrastText: '#fff',
      },
      secondary: {
        light: '#ff7961',
        main: '#f44336',
        dark: '#ba000d',
        contrastText: '#000',
      },
      warning: {
          dark:'yellow'
      },
    },
  });
